import React, { Component } from "react";
import { Route, NavLink, HashRouter } from "react-router-dom";
import "./App.css";

class App extends Component {
  render() {
    return (
      <HashRouter>
        <div>
          <h1>Best Community Service</h1>
          <h2>Helping the community in the Best ways!</h2>
          <ul className="header">
            <li>
              <Navlink exact to="/">
                Home
              </Navlink>
            </li>
          </ul>
        </div>
      </HashRouter>
    );
  }
}

export default App;
